{-
Please consult the RNA codon table, which specifies the translation of 
RNA codons into the 20-symbol amino acid alphabet.

Given: An RNA string s corresponding to a strand of mRNA (of length at most 10 knt).

Return: The protein string encoded by s.

Sample Dataset
AUGGCCAUGGCGCCCAGAACUGAGAUCAAUAGUACCCGUAUUAACGGGUGA
Sample Output
MAMAPRTEINSTRING
-}

import RNA

input = ""

triplets []  = []
triplets str = (take 3 str) : (triplets $ drop 3 str)

result = takeWhile (not . is_stop) $ map rna_codon $ triplets input



main = putStrLn result